    false,nt"url": null,nt"notes": "This annual narrative report for Bowdoin
    National Wildlife Refuge, Bowdoin Wetlands Management District, Creedman Coulee,
    Lake Thibadeau, Black Coulee, and Hewitt Lake outlines Refuge accomplishments during
    the 1983 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. The report includes a planning section which discusses management
    planning and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, volunteer programs, funding, and safety is given.
    Habitat management is also covered; subjects include wetlands, grasslands, and WPA
    easements. The wildlife section of the report discusses waterfowl, marsh birds and
    waterbirds, shorebirds, game mammals, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive programs, hunting, and law enforcement. The equipment and facilities
    section of the report provides information about new construction, major maintenance,
    and energy conservation. Cooperative programs and items of interest are provided
    at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
